	changePage(e,index){

		console.log(e,index)
	}

	render(){
		return (
			<div  className="App">
			<div id="container">
				<div id="header">
					<div id="logo">
						<h1>Product management</h1>
					</div>
					<div id="menu">
						<ul>
							<li onClick={(e) => this.changePage(e, 0)}>Homepage</li>
							<li onClick={(e) => this.changePage(e, 1)}>Suppliers</li>
							<li onClick={(e) => this.changePage(e, 2)}>Categories</li>
							<li onClick={(e) => this.changePage(e, 0)}v>Products</li>	
							<li>Log Out</li>
						</ul>
					</div>
				</div>
				<TodoMain/>
			</div>
			</div>

		  );

	}
}


export default App;
